import React from 'react';
import { Col, Container, Row } from 'react-bootstrap';

//component
import ListLatestPlayers from '../../reportType/ListLatestPlayers'
import CardTopPlayers from '../../players/component/CardTopPlyers';
import ListReportsTypeOfRegion from '../../reportType/ListReportsTypeOfRegion';
//css
import './homepage.scss'

const HomePage = () => {


    const foo = "alert('dio can')";
    return (
        <Container fluid className='mt-5'> 
            <Row>
                {foo}
                <Col className='list-top-players mr-2'>
                    <h2>Top reported</h2>
                    <CardTopPlayers />
                </Col>
                <Col className='list-last-report mr-2'>
                    <h2>Last report</h2>
                    <ListLatestPlayers/>
                </Col>
                <Col className='list-reportType'>
                    <h2>Report Type</h2>
                    <ListReportsTypeOfRegion/>
                </Col>
            </Row>
        </Container>
    );

}
export default HomePage;
